(6682, 'worked on candlepin updates', 'Completed Tasks :\n\n1. On the candlepin footer the email has to be “info@candlepin.com”  and the name of the place should say Candle Pin not Webster Lanes (on Candle Pin Page)\n- Updated\n\n2. Remove hours of operations from the footer on the candlepin page\n- updated\n\n3. Remove the following text from both candlepin and Websters home page. It will be under the reserve now button in the Reservation section:\n\n“All online reservations include shoe rental at no additional charge for up to 6 bowlers/lane. Please note any special requests when reserving lanes (adjoining lanes, etc.)”\n-removed\n\n\n4. On candle pin website on the Go Bowling page please move the following red text: “Prices Are Per Lane, NOT Per Person For Unlimited Bowling AND Includes Bowling Shoes!”\n- removed\n\n\n5. On candlepin contact page make sure the email is correct info@candlepin.com and the address is correctly formatted\n-updated\n\n\n6. Reservation page on candlepin CTA to Call to Reserve and it should be a tel:7818780219 as the link when the button is clicked.\n- Updated.\n\n7. Payment information:\n\nPayPal email: john_pumphrey@msn.com\n\nWhen reservations or an order is complete\n\nSend the order via email to two emails:\ntimberlanesabington@gmail.com\ntlorders1@gmail.com\n\n- Updated\n\n8. On the pro shop page make sure that the add to bag button is working correctly and also if you can change add to bag to add to cart\n\n- Updated\n\n9. Review all of the links, a lot of them are getting 404 errors or are not directing to right page.\n- Updated league schedule links.\n\n\n--------------\n\nPending Tasks :\n\n\n1. On the league page, we would like it set up like a grid. Overall this should be something that is hard. You can mostly likely find a plugin or just find a html table template.\n\n2. Also on the league page we would like the “Cribbage” one to stand out so can you just make this bold\n\n3. How is the current inventory of the lanes managed? Do they just put how many are available in their location or could you set them for each day?\n\n4. We would like a quick access link on the candlepin home page that will link to the Webster link.\n\n5. Make sure both home sliders are optimized and are big enough for mobile and all other devices\n\n6. On the events and parties page. Make sure all the images are right. Some of the images aren’t the right ones anymore. They should be the same pictures that we are using in the reservation system\n\n7. Make sure that candlepin and Webster are two different sites. Currently there are multiple locations where I will jump from Webster to candlepin. This should not be happening\n\n8. Https certifications needs to be implemented properly some pages are giving us a error about not being secure\n- Its showing SSL certificate showing Invalid/ Expired.\n\n9. Remove Announcement Bar for the Webster Website (Will add later)\n- Announcement already disabled.\n', 8, 30, '2020-07-22 14:04:44', '2020-07-14', '8.00', 1, 5, 30, 30, '2020-07-14', '00:00:00', '0', NULL, NULL);
