(6707, 'worked on map refresh updates', '\n1. Route Details api ( App ) :\n\n\n\nURL: https://mrmojo.segurotechnologies.com/api/device/location/details\nResponse:\nApp - Route details api response.PNG\ni. map_refresh_time\n:- map refresh time for guest user ( in seconds )\nii. location_update_time\n:- map refresh time for driver ( in seconds )\niii. location_update_distance\n:- call map update api from drivers after specific meter distance.\n\n\n\n2. Add Route ( Admin Backend )\nURL:{ {URL}}/api/admin/location/save\nParams:\n\nmap_refresh_time:  value in seconds\nlocation_update_time: value in seconds\nlocation_update_distance: value meters\n\n3. Update Route ( Admin Backend )\nURL:{{URL}}/api/admin/location/update\n\n4. Response updated in View Route ( Admin Backend )\nURL: /api/admin/location/details\n\nAdmin backend postman collection : https://documenter.getpostman.com/view/7537114/Szf3aqaq?version=latest#0039e508-5e8d-4956-9e50-457f95641238\n  \n', 141, 30, '2020-07-30 12:54:08', '2020-07-30', '2.00', 1, 5, 30, 30, '2020-07-30', '00:00:00', '0', NULL, NULL),
